import React from 'react'
import image from ""
import "../../../src/index.css"

function Home() {
  return (
    <div>
      <section className="hero is-medium is-info is-bold">
        <div className="columns is-mobile is-centered ">
          <img className="background-video" src={image} alt="mexico" />
        </div>
      </section>
    </div>
  );
}

export default Home;
